function lazyLoad(){let e=[].slice.call(document.querySelectorAll("img.lazyload[data-src]"));if("IntersectionObserver"in window){let t=new IntersectionObserver(function(e,a){e.forEach(function(e){if(e.isIntersecting){let a=e.target;a.src=a.dataset.src,a.classList.remove("lazyload"),t.unobserve(a)}})});e.forEach(function(e){t.observe(e)})}else e.forEach(function(e){e.src=e.dataset.src,e.classList.remove("lazyload")})}